from GMH:

&quot;My boyfriend's grandparents are both in the hospital in separate rooms. 

When asked what he wants for lunch, he said &quot;to spend it with my wife.&quot; He got his wish.

When he held her hand, his heart monitor showed it skipped a beat and hers fluttered.

She's 84, he's 102. Everlasting love GMH.&quot;
